iterations.yara_rule:
rule Bypass_Evasion
{
    meta:
        description = "Evasion bypass detection in sandbox environments"
        cape_options = "bp0=$pattern0+0,action0=skip,bp1=$pattern1+0,action1=skip,bp2=$pattern2+0,action2=skip,count=0"

    strings:
        $pattern0 = { E8 ?? ?? ?? ?? 85 C0 0F 84 ?? ?? ?? ?? }
        $pattern1 = { 6A ?? 5A 8B CE E8 ?? ?? ?? ?? 85 C0 }
        $pattern2 = { E8 ?? ?? ?? ?? 0F 84 83 C4 ?? 85 C0 }

    condition:
        any of them
}

rule Bypass_Sample_Evolved
{
    meta:
        description = "Evasion bypass rule - evolved"
        cape_options = "bp0=$pattern0+0,action0=skip,bp1=$pattern1+0,action1=skip,bp2=$pattern2+0,action2=skip,count=0"

    strings:
        $pattern0 = { ?? ?? ?? ?? 8B 45 FC }
        $pattern1 = { 83 F8 01 74 12 8B 4D FC }
        $pattern2 = { 3D 00 10 00 0F 82 }
    condition:
        any of them
}

rule Bypass_Sample
{
    meta:
        description = "Evasion bypass targeting jump and call instructions"
        cape_options = "bp0=$pattern0+0,action0=skip,bp1=$pattern1+0,action1=skip,bp2=$pattern2+0,action2=skip,count=0"

    strings:
        $pattern0 = { E8 ?? ?? ?? ?? 83 C4 ?? 85 C0 0F 84 ?? ?? ?? ?? }
        $pattern1 = { FF 75 08 ?? FF 75 08 ?? FF 75 08 ?? FF 75 08 ?? 8B 45 ?? }
        $pattern2 = { 6A ?? 5A 8B CE E8 ?? ?? ?? ?? 85 C0 }

    condition:
        any of them
}
